import { Box } from '@material-ui/core';
import * as React from 'react';
import { BrowserRouter } from 'react-router-dom';
import { Navbar } from "./components/NavBar";
import AppRouter from './routes/AppRouter';

const App: React.FC = () => {
  return (
    <React.Fragment>
      <BrowserRouter>
        <Navbar/>
        <Box paddingTop={'70px'}>

          <AppRouter/>
        </Box>
      </BrowserRouter>

    </React.Fragment>
  );
}

export default App;
